<script src="https://ajax.googleapis.com/ajax/libs/jquery/3.6.4/jquery.min.js"></script>
<script>
    const citiies = ["RIYADH", "JEDDAH", "HOFUF"]
    $('#CommunityofInterest').hide();

    function changeCityOfInterest() {
        $('#CommunityofInterest option:selected').prop("selected", false);
        $('.riyadh').hide();
        $('.jeddah').hide();
        $('.hofuf').hide();
        $('#CommunityofInterest').hide();
        const selectedText = $('#CityOfInterest').find(':selected').text();
        const selectedValue = $('#CityOfInterest option:selected').val();
        console.log("Selected Text: " + selectedText);
        console.log("Selected Value: " + selectedValue);
        console.log("city: " + citiies.includes(selectedValue));
        if (citiies.includes(selectedValue)) {
            $('#CommunityofInterest option:selected').prop("selected", false);
            $('.riyadh').hide();
            $('.jeddah').hide();
            $('.hofuf').hide();
            $('#CommunityofInterest').hide();
            $('#CommunityofInterest').show();
            if (selectedValue == "RIYADH") {
                $('#CommunityofInterest option:selected').prop("selected", false);
                $('.riyadh').show();
                $('.jeddah').hide();
                $('.hofuf').hide();
            }
            if (selectedValue == "JEDDAH") {
                $('#CommunityofInterest option:selected').prop("selected", false);
                $('.jeddah').show();
                $('.riyadh').hide();
                $('.hofuf').hide();
            }
            if (selectedValue == "HOFUF") {
                $('#CommunityofInterest option:selected').prop("selected", false);
                $('.hofuf').show();
                $('.riyadh').hide();
                $('.jeddah').hide();
            }

        } else {
            $('#CommunityofInterest option:selected').prop("selected", false);
            $('.riyadh').hide();
            $('.jeddah').hide();
            $('.hofuf').hide();
            $('#CommunityofInterest').hide();

        }

    }
</script>

